import React from "react";
import "./Card.css";
import "../../cards.json";

const Card = props => (
  <span className="clicked" onClick={() => props.cardClicked(props.frogData.id)}>
    <div className="card card-base">
      <div className="img-container">
        <img alt="frog-image" src={props.frogData.image}/>
      </div>
    </div>
  </span>
);

export default Card;
